Digital Playground - Fighters
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Description: Two beautiful, passionate girls from opposite walks of life come together in a battle of lust, raw emotion, egos and unyielding wills to fight it out in a stealthy boxing match. Gorgeous yet tough Jesse Jane combats her troubled home life with the help of her sister Riley Steele and coach. Sexy Kayden Kross punches out her feelings through her boxing, supported by her sexy best friend, Stoya. They test whose desire and passion will prevail. BiBi Jones stars as the new girl in town who sleeps with Jesse's dad creating even more fighting. The intense physical sparring both in and outof the ring leads to some fierce sexual encounters.

Cast: Jesse Jane   Kayden Kross   Riley Steele   Stoya   Manuel Ferrara   Bibi Jones   Vicki Chase   Erik Everhard   Tommy Gunn   Ramon Nomar   Toni Ribas   Charles Dera   Marco Rivera  

